import ReactDOM from "react-dom/client";
import React from "react";

function Contact() {
  function scrollToBottom (){ 
    window.scrollTo({ 
      top: document.documentElement.scrollHeight, 
      behavior: 'auto'
      
    }); 
  };
  
}

export default Contact;
